script: |
  super -f text -I q4452.spq | sort > q4452.out

inputs:
  - name: q4452.spq
    data: |
      SELECT DISTINCT - - col1 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT - - 46 + + col1 IN ( + + col0, 38 / col1 + - col0 + - - col1 + 60 );
  - name: tab0

outputs:
  - name: q4452.out
    data: |
      1
      21
      81
